	@Test
	public void testHackerTestCase4() throws IOException {
		long[] output = new long[10];
		int loop = 1;
		for (int i = 1; i <= 10; i++) {
			output[i - 1] = this.similarity.checkstringSimilarity(getTestDataFromFile("hackerTest4In" + i + ".txt"));
			if (i == 9 && loop > 1) {
				// System.out.println("reset "+loop);
				i = 1;
				loop--;
			}
		}
		assertEquals(output[0], 48829);
		assertEquals(output[1], 30426);
		assertEquals(output[2], 10988);
		assertEquals(output[3], 97771);
		assertEquals(output[4], 101905);
		assertEquals(output[5], 103012);
		assertEquals(output[6], 46802);
		assertEquals(output[7], 89444);
		assertEquals(output[8], 110727);
		assertEquals(output[9], 93383);

	}
